import React from 'react';
import {FaTwitter} from 'react-icons/fa';
import Slide from 'react-reveal/Slide';
import Bounce from 'react-reveal/Bounce';


function Start_Load() {
  return (
    <div className="start-load-container">
      <div className="flex">
      <Slide left>
      <h1>Twitter</h1>
      </Slide>
      <Slide right>
      <h1>Master</h1>
      </Slide>
      </div>
      <Bounce bottom>

      <FaTwitter></FaTwitter>
      </Bounce>

    </div>
  );
}

export default Start_Load;
